      var endDate = '';
      var year = '';
      if (value[0] < value[1]) {
        startDate = range[1][value[1]];
        endDate = range[0][value[0]];
      } else {
        startDate = range[0][value[0]];
        endDate = range[1][value[1]];
      }
      var type = this.sf_index_three_data; // 参与身份
